import React, { Component } from 'react';
import '../App.css';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="container">
          <div className="row">
            <div className="col-md-8 m-auto">
                <p className="lead text-center">
                    Welcome
                </p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
